CREATE SCHEMA grupos;
CREATE TABLE IF NOT EXISTS grupos.permissoes (
  id SERIAL PRIMARY KEY,
  nome VARCHAR(255) NOT NULL
);
CREATE TABLE IF NOT EXISTS grupos.departamentos (
  id SERIAL PRIMARY KEY,
  nome VARCHAR(255) NOT NULL
);
CREATE TABLE IF NOT EXISTS grupos.interesses (
  id SERIAL PRIMARY KEY,
  interesse VARCHAR(45) NOT NULL
);
CREATE TABLE IF NOT EXISTS grupos.materias (
  codigo VARCHAR(15) PRIMARY KEY,
  nome VARCHAR(255) NOT NULL,
  id_departamento INT,
  CONSTRAINT fk_id_departamento
    FOREIGN KEY(id_departamento)
      REFERENCES grupos.departamentos(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.turmas (
  id SERIAL PRIMARY KEY,
  codigo VARCHAR(15) NOT NULL,
  semestre VARCHAR(8) NOT NULL,
  horario VARCHAR(255) NOT NULL,
  codigo_materia varchar(15) NOT NULL,
  CONSTRAINT fk_codigo_materia
    FOREIGN KEY(codigo_materia)
      REFERENCES grupos.materias(codigo) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.participantes (
  matricula VARCHAR(15) PRIMARY KEY,
  nome VARCHAR(60) NOT NULL,
  email VARCHAR(255) NOT NULL,
  ocupacao VARCHAR(15) NOT NULL
);
CREATE TABLE IF NOT EXISTS grupos.usuarios (
  id SERIAL PRIMARY KEY,
  usuario VARCHAR(60) NOT NULL,
  senha varchar(255) NOT NULL,
  matricula_participante VARCHAR(15) NOT NULL,
  CONSTRAINT fk_matricula_participante
    FOREIGN KEY(matricula_participante)
      REFERENCES grupos.participantes(matricula) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.arquivos (
  id SERIAL PRIMARY KEY,
  imageName VARCHAR(255) NOT NULL,
  tipo VARCHAR(70) NOT NULL,
  arquivo BYTEA NOT NULL
);
CREATE TABLE IF NOT EXISTS grupos.grupos (
  id SERIAL PRIMARY KEY,
  criado_em TIMESTAMP NOT NULL,
  modificado_em TIMESTAMP NOT NULL,
  descricao varchar(255) NOT NULL,
  nome VARCHAR(255) NOT NULL,
  ativo BOOLEAN NOT NULL,
  criado_por INT NOT NULL,
  turma_id INT NOT NULL,
  id_imagem int,
  CONSTRAINT fk_criado_por
    FOREIGN KEY(criado_por)
      REFERENCES grupos.usuarios(id) ON DELETE CASCADE,
  CONSTRAINT fk_turma_id
    FOREIGN KEY(turma_id)
      REFERENCES grupos.turmas(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_imagem
    FOREIGN KEY(id_imagem)
      REFERENCES grupos.arquivos(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.avaliacoes (
  id SERIAL PRIMARY KEY,
  id_usuario INT NOT NULL,
  id_grupo INT NOT NULL,
  avaliacao INT,
  CONSTRAINT fk_id_usuario
    FOREIGN KEY(id_usuario)
      REFERENCES grupos.usuarios(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_grupo
    FOREIGN KEY(id_grupo)
      REFERENCES grupos.grupos(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.avaliacoes_pendentes (
  id SERIAL PRIMARY KEY,
  id_usuario INT NOT NULL,
  id_grupo INT NOT NULL,
  id_avaliador INT NOT NULL,
  pendente BOOLEAN,
  CONSTRAINT fk_id_usuario
    FOREIGN KEY(id_usuario)
      REFERENCES grupos.usuarios(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_avaliador
    FOREIGN KEY(id_avaliador)
      REFERENCES grupos.usuarios(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_grupo
    FOREIGN KEY(id_grupo)
      REFERENCES grupos.grupos(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.pedidos (
  id SERIAL PRIMARY KEY,
  id_usuario INT NOT NULL,
  id_grupo INT NOT NULL,
  aceito BOOLEAN,
  CONSTRAINT fk_id_usuario
    FOREIGN KEY(id_usuario)
      REFERENCES grupos.usuarios(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_grupo
    FOREIGN KEY(id_grupo)
      REFERENCES grupos.grupos(id) ON DELETE CASCADE
);

CREATE TABLE IF NOT EXISTS grupos.grupos_interesses (
  id SERIAL PRIMARY KEY,
  id_grupo INT NOT NULL,
  id_interesse INT NOT NULL,
  CONSTRAINT fk_id_grupo
    FOREIGN KEY(id_grupo)
      REFERENCES grupos.grupos(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_interesse
    FOREIGN KEY(id_interesse)
      REFERENCES grupos.interesses(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.permissoes_usuarios (
  id SERIAL PRIMARY KEY,
  id_usuario INT NOT NULL,
  id_permissao INT NOT NULL,
  CONSTRAINT fk_id_usuario
    FOREIGN KEY(id_usuario)
      REFERENCES grupos.usuarios(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_permissao
    FOREIGN KEY(id_permissao)
      REFERENCES grupos.permissoes(id) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.turmas_participantes (
  id SERIAL PRIMARY KEY,
  id_turma INT NOT NULL,
  matricula_participante VARCHAR(15) NOT NULL,
  CONSTRAINT fk_id_turma
    FOREIGN KEY(id_turma)
      REFERENCES grupos.turmas(id) ON DELETE CASCADE,
  CONSTRAINT fk_matricula_participante
    FOREIGN KEY(matricula_participante)
      REFERENCES grupos.participantes(matricula) ON DELETE CASCADE
);
CREATE TABLE IF NOT EXISTS grupos.usuarios_grupos (
  id SERIAL PRIMARY KEY,
  id_usuario INT NOT NULL,
  id_grupo INT NOT NULL,
  CONSTRAINT fk_id_usuario
    FOREIGN KEY(id_usuario)
      REFERENCES grupos.usuarios(id) ON DELETE CASCADE,
  CONSTRAINT fk_id_grupo
    FOREIGN KEY(id_grupo)
      REFERENCES grupos.grupos(id) ON DELETE CASCADE
);
